import React from 'react';
import logo from './logo.svg';
import poll from './Event'
import test from "./test-assignment"
import './App.css';

function App() {

   let value=JSON.parse(JSON.stringify(test));
    let inst=this;
    for(let data of value){
        inst=data;
   }

  return (
    <div className="App">

        {inst.awayName}

    </div>
  );
}

export default App;
